import Categories from "./components/Categories";
import Header from "./components/Header";
import "./App.css";
import { Route, Routes } from "react-router-dom";
import { American, Appetizers, Breakfast, Entrees } from "./components/SubCategories";

function App () {
    return (
        <>
            <Header />
            <Categories />
            <Routes>
                <Route
                    path="/breakfast"
                    element={<Breakfast />}
                />
                <Route 
                    path="/appetizers"
                    element={<Appetizers />}
                />
                <Route
                    path="/entrees"
                    element={<Entrees />}
                />
                <Route
                    path="/american"
                    element={<American />}
                />
            </Routes>
        </>
    )
}

export default App;
